import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import ContactoIcon from '/src/d';

function Home() {
  return (
    <section className="hero">
      <h1>Bienvenidos a Fondos.com</h1>
      <p>Tu sitio de información y servicios financieros</p>
    </section>
  );
}

function Corporativo() {
  return <div className="page">Corporativo</div>;
}

function Documentos() {
  return <div className="page">Documentos</div>;
}

function Servicios() {
  return (
    <div className="page">
      <h2>Servicios</h2>
      <ul>
        <li>Estado de cuenta</li>
        <li>Tipos de Ahorro</li>
        <li>Líneas de Crédito</li>
        <li>Convenios</li>
        <li>PQRS</li>
      </ul>
    </div>
  );
}

function ControlSocial() {
  return <div className="page">Control Social</div>;
}

function Emprendedores() {
  return <div className="page">Emprendedores</div>;
}

function Contacto() {
  return <div className="page">Contacto</div>;
}

function Login() {
  return <div className="page">Login</div>;
}

function App() {
  return (
    <Router>
      <div className="background-container">
        <header className="header">
          <div className="logo">fondos.com</div>
          <Link className="navItem" to="/">
            <img src="/public/down.png" alt="Home" />Home
          </Link>
          <Link className="navItem" to="/corporativo">
            <img src="/public/down.png" alt="Corporativo" />Corporativo
          </Link>
          <Link className="navItem" to="/documentos">
            <img src="/public/down.png" alt="Documentos" />Documentos
          </Link>
          <Link className="navItem" to="/servicios">
            <img src="/public/down.png" alt="Servicios" />Servicios
          </Link>
          <Link className="navItem" to="/control-social">
            <img src="/public/down.png" alt="Control Social" />Control Social
          </Link>
          <Link className="navItem" to="/emprendedores">
            <img src="/public/down.png" alt="Emprendedores" />Emprendedores
          </Link>
          <Link className="navItem" to="/contacto">
            <img src="/public/down.png" alt="Contacto" />Contacto
          </Link>
          <Link className="navItem" to="/login">
            <img src="/public/down.png" alt="Login" />Login
          </Link>
        </header>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/corporativo" element={<Corporativo />} />
          <Route path="/documentos" element={<Documentos />} />
          <Route path="/servicios" element={<Servicios />} />
          <Route path="/control-social" element={<ControlSocial />} />
          <Route path="/emprendedores" element={<Emprendedores />} />
          <Route path="/contacto" element={<Contacto />} />
          <Route path="/login" element={<Login />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
